import React, { Component } from "react";

class Admin extends Component {
    render(){
        this.state = {
            loggedIn: false
        }
        if (this.state.loggedIn){
            return (
                <p>
                  Admin
                </p>

            );
        }else {
            return (
                <>
                    <p>Please Log in!</p>
                    <form>
                    <ul>
                        <li>
                            <input type="text" name="username"></input>

                        </li>
                    </ul>
                    </form>
                </>
            )
        }
    }
}

export default Admin;
